		text: `bukchon hanok village (korean traditional house village where you walk around and take pics) -> then go samcheongdong or insadong for food or really nice cafes (theyâ€™re right next to the village)<br><br>		namsan tower (highest point in seoul and you can see the whole city when you go to the top)<br>		<br>		 gyeongbokgung palace / gwanghwamun<br>		<br>		starfield coex mall (the one with really pretty library)<br>		<br>		shopping:<br>		<br>		myeongdong : itâ€™s the most popular/biggest shopping district esp for foreigners and itâ€™s nice to look around, but the markets mostly only target tourists and stuff is kinda overpriced there. so if you want to shop street clothes i wouldnâ€™t recommend, but makeup and branded clothes the price is the same everywhere so itâ€™s ok to shop there<br>		<br>		hongdae : the street clothes are super cheap here and there are a lot of food/small shops you can go. but its really crowded so avoid weekends!! oh yeah there are also a lot of kpop buskings here too<br>		<br>		gangnam : shopping district is super big, lots and lots of restaurants and it has all kinds of shops varying from street to designer brands! if you go gangnam i really recommend the underground (subway station) shopping district<br>		<br>		garosugil : this place has heaps of aesthetic cafes, and also a lot of clothing shops. itâ€™s just one really long street so you just walk along and shop, and the street is pretty aesthetic as well<br>		<br>		** shops/ brands i really recommend : <br>		wonderplace : streetwear shop that sells like thrasher and korean street brands<br>		A-land : similar to wonderplace, but it has heaps more aesthetic accessories, bags etc<br>		Aroundthecorner : i really recommend this place, it sells champion, thrasher and heaps of korean brands that are really nice for cheap<br>		SPAO : nice to look around if itâ€™s on sale lol`	
